No tengo palabras suficientes para darle las gracias a cada una de las personas que ayudó con el rescate de Pelu

Solo fue que publicará pidiendo ayuda para que personas maravillosas hubieran dicho " presente" y hubieran estado 4 días sin parar primero buscándolo y luego tratando de agarrarlo. ( tarea que no fue facil)

Pelu duró 18 días perdido. 18 días que ya nos estaba jugando en contra porque cada día que pasaba era peor para la condición de su boquita 

Ayer jueves, logro caer en la trampa, débil, Flaco, sin acicalarse quien sabe hace cuanto 💔😥

Pelu quedará en manos de su madrina quien decidió quedarse con el para que JAMAS vuelva a pasar por nada parecido. 
Esa criatura ya sufrió demasiado como para pensar en que termine otra vez en la calle

Quiero dar GRACIAS a las personas maravillosas que se unieron desde el primer día, para correr, trepar techos, sudar, gritar por Pelu

